import React from 'react';
import styled from 'styled-components';

const Right = () => {

    const { sub_stage } = useSelector(state => state);

    return (
        <Style>
            <header>
                <span> Input </span>
                <span> Your Earnings </span>
                <span> Key to start </span>
            </header>
        </Style>
    );
}

export default Right;

const Style = styled.div`
    background: #fff;
    min-height: 100vh;
    padding: 20px 50px;

    header {
        display: flex;
        justify-content: space-between;

        span {
            font-size: 14px;
            color: #1d2b44;
        }

        &:nth-child(${ sub_stage + 1 }) {
            font-weight: bold;
            border-bottom: 2px solid #1d2b44;
        }
    }
`
